import React from 'react';
import { useNavigate } from 'react-router-dom';

const WaitlistSignUp = () => {
  const navigate = useNavigate();

  const handleBack = () => {
    navigate('/');
  };

  return (
    <div className="relative min-h-screen w-full overflow-hidden flex flex-col">
      {/* Background Image */}
      <img 
        src="/assets/waitlist sign up.png" 
        alt="Waitlist Sign Up Background"
        className="absolute inset-0 w-full h-full object-cover z-0"
      />
      
      {/* Back Button - Top Right Corner */}
      <button
        onClick={handleBack}
        className="absolute top-8 right-8 z-50 bg-white bg-opacity-80 hover:bg-opacity-100 text-dark-green font-metropolis font-bold px-6 py-3 rounded-lg shadow-lg transition-all duration-200 hover:scale-105"
      >
        ← Back
      </button>
      
      {/* Footer - Western Developers Society 2025 */}
      <div className="absolute bottom-0 left-0 right-0 z-50 mt-auto">
        <div className="bg-dark-green py-4 text-center">
          <p className="text-white font-metropolis text-sm">
            © Western Developers Society 2025
          </p>
        </div>
      </div>
    </div>
  );
};

export default WaitlistSignUp;
